private static BytesRef toSortableBytes(Long l) {
  if (l == null) {
    return null;
  } else {
    final BytesRefBuilder bytes = new BytesRefBuilder();
    NumericUtils.longToPrefixCoded(l, 0, bytes);
    return bytes.get();
  }
}

